import { platformBrowserDynamic } from '@angular/platform-browser-dynamic';

import { AppModule } from './app/app.module';


platformBrowserDynamic().bootstrapModule(AppModule)
  .catch(err => console.error(err));

export class Login {

  contador: number = 0;
function registrarLogar() {
  if(contador%2 == 0) document.getElementsByName("app-login")[0].style.marginLeft = "-100%";
  else document.getElementsByName("app-login")[0].style.marginLeft = "0%";
  contador++;
}

}
